package cn.bjjoy.bms.setting.persist.model;import java.io.Serializable;/** * 类描述   :  * 创建人	：system * 创建时间 ：2018-10-10 15:34:16 * @version 1.0 */public class System implements Serializable {	/**	 */	private static final long serialVersionUID = -1166537454486799299L;	/**  */	private int id;	/**  */	private String system;	/** 省级 */	private String province;	/**  */	private String city;	/** 县(区) */	private String county;	 	/** 	 * 获取 主键	 */		public int getId() {		return id;	}	/** 	 * 设置 主键	 */	public void setId(int id) {		this.id = id;	}	 	/** 	 * 获取 	 */		public String getSystem() {		return system;	}	/** 	 * 设置 	 */	public void setSystem(String system) {		this.system = system;	}	 	/** 	 * 获取省级 	 */		public String getProvince() {		return province;	}	/** 	 * 设置省级 	 */	public void setProvince(String province) {		this.province = province;	}	 	/** 	 * 获取 	 */		public String getCity() {		return city;	}	/** 	 * 设置 	 */	public void setCity(String city) {		this.city = city;	}	 	/** 	 * 获取县(区) 	 */		public String getCounty() {		return county;	}	/** 	 * 设置县(区) 	 */	public void setCounty(String county) {		this.county = county;	}}